import sqlite3
from sqlite3 import Error

def connect(file):
    conn = None
    try:
        conn = sqlite3.connect(file)
    except Error as er:
        print(er)
    
    return conn

def update_student(conn, data):
    sql = 'UPDATE student SET id=? WHERE id=?'
    cur = conn.cursor()
    cur.execute(sql, data)
    conn.commit()

def update_assignment_student(conn, data):
    cur = conn.cursor()
    cur.execute('SELECT COUNT(*) FROM submitted_assignment WHERE student_id=?',(data[1],))
    duplicates = cur.fetchone()[0]
    sql = 'UPDATE submitted_assignment SET student_id=? WHERE student_id=?'

    for x in range(duplicates):
        cur.execute(sql, data)
    conn.commit()

